import React from "react";
import BG from "../assets/BG.mp4";
const LandHome = () => {
  return (
      <>
    <div>
      <video
        autoPlay
        loop
        muted
        disablePictureInPicture
        controlsList="nodownload"
        style={{
          position:'absolute',
          width:'100%',
          left: '50%',
          top:'53.4%',
          height:'calc(100vh - 6.8493150684931505vh)',
          objectFit:'cover',
          transform:'translate(-50%,-50%)',
          zIndex:'1'
        }}
      >
        <source src={BG} type="video/mp4" />
      </video>
      <div style={{
        zIndex:'2'
      }} className="text">
        <h2>Never Stop</h2>
        <h3>Exploring the Virtual World</h3>
        <p>sdasdasds</p>
      </div>
    </div>
    </>
  );
};

export default LandHome;
